import React from "react";

export const Menu = (
    isMenuOpened,
    setIsMenuOpened,
    handleMenuClick,
) => {
    return (
        <div className="menu">
            <img 
                className="menu-hamburger-icon" 
                alt="Menu" 
                src={
                    !isMenuOpened ? 
                        process.env.PUBLIC_URL + '/images/hamburger-menu/hamburger-menu-closed.svg' : 
                        process.env.PUBLIC_URL + '/images/hamburger-menu/hamburger-menu-opened.svg'
                    }
                onClick={handleMenuClick}
                >
                </img>
            <div className="wrap-menu-items">
                <ul className="list">
                    <li className="item">Home</li>
                    <li className="item">Foto Stanze</li>
                    <li className="item">Dove Siamo</li>
                    <li className="item">Tariffe e Condizioni</li>
                    <li className="item">Informazioni e Preventivi</li>
                </ul>
            </div>
        </div>
    );
}
